      <div>

        <h2 id="role-form-title">Add Country Details</h2>


 <div id="role-form-outer-div"><Form id="form" onSubmit={this.props.onCountrySubmit}>



  <Form.Group as={Row}>
    <Form.Label column sm={2}>
    Country
